eader users understand the purpose of the button. [Learn about input image alt text](https://dequeuniversity.com/rules/axe/4.8/input-image-alt).",score:null,scoreDisplayMode:"notApplicable"},"label-content-name-mismatch":{id:"label-content-name-mismatch",title:"Elements with visible text labels have matching accessible names.",description:"Visible text labels that do not match the accessible name can result in a confusing experience for screen reader users. [Learn more about accessible names](https://dequeuniversity.com/rules/axe/4.8/label-content-name-mismatch).",score:null,scoreDisplayMode:"notApplicable"},label:{id:"label",title:"Form elements have associated labels",description:"Labels ensure that form controls are announced properly by assistive technologies, like screen readers. [Learn more about form element labels](https://dequeuniversity.com/rules/axe/4.8/label).",score:null,scoreDisplayMode:"notApplicable"},"landmark-one-main":{id:"landmark-one-main",title:"Document has a main landmark.",description:"One main landmark helps screen reader users navigate a web page. [Learn more about landmarks](https://dequeuniversity.com/rules/axe/4.8/landmark-one-main).",score:null,scoreDisplayMode:"informative",details:{type:"table",headings:[{key:"node",valueType:"node",subItemsHeading:{key:"relatedNode",valueType:"node"},label:"Failing Elements"}],items:[{node:{type:"node",lhId:"1-7-HTML",path:"1,HTML",selector:"html",boundingRect:{top:0,bottom:1580,left:0,right:1705,width:1705,height:1580},snippet:"\u003Chtml xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"en\">",nodeLabel:"html",explanation:"Fix all of the following:\n  Document does not have a main landmark"}}],debugData:{type:"debugdata",impact:"moderate",tags:["cat.semantics","best-practice"]}}},"link-name":{id:"link-name",title:"Links do not have a discernible name",description:"Link text (and alternate text for images, when used as links) that is discernible, unique, and focusable improves the navigation experience for screen reader users. [Learn how to make links accessible](https://dequeuniversity.com/rules/axe/4.8/link-name).",score:0,scoreDisplayMode:"binary",details:w},"link-in-text-block":{id:"link-in-text-block",title:"Links are distinguishable without relying on color.",description:"Low-contrast text is difficult or impossible for many users to read. Link text that is discernible improves the experience for users with low vision. [Learn how to make links distinguishable](https://dequeuniversity.com/rules/axe/4.8/link-in-text-block).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},list:{id:"list",title:"Lists contain only `\u003Cli>` elements and script supporting elements (`\u003Cscript>` and `\u003Ctemplate>`).",description:"Screen readers have a specific way of announcing lists. Ensuring proper list structure aids screen reader output. [Learn more about proper list structure](https://dequeuniversity.com/rules/axe/4.8/list).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},listitem:{id:"listitem",title:"List items (`\u003Cli>`) are contained within `\u003Cul>`, `\u003Col>` or `\u003Cmenu>` parent elements",description:"Screen readers require list items (`\u003Cli>`) to be contained within a parent `\u003Cul>`, `\u003Col>` or `\u003Cmenu>` to be announced properly. [Learn more about proper list structure](https://dequeuniversity.com/rules/axe/4.8/listitem).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},"meta-refresh":{id:"meta-refresh",title:"The document does not use `\u003Cmeta http-equiv=\"refresh\">`",description:"Users do not expect a page to refresh automatically, and doing so will move focus back to the top of the page. This may create a frustrating or confusing experience. [Learn more about the refresh meta tag](https://dequeuniversity.com/rules/axe/4.8/meta-refresh).",score:null,scoreDisplayMode:"notApplicable"},"meta-viewport":{id:"meta-viewport",title:"`[user-scalable=\"no\"]` is not used in the `\u003Cmeta name=\"viewport\">` element and the `[maximum-scale]` attribute is not less than 5.",description:"Disabling zooming is problematic for users with low vision who rely on screen magnification to properly see the contents of a web page. [Learn more about the viewport meta tag](https://dequeuniversity.com/rules/axe/4.8/meta-viewport).",score:null,scoreDisplayMode:"notApplicable"},"object-alt":{id:"object-alt",title:"`\u003Cobject>` elements have alternate text",description:"Screen readers cannot translate non-text content. Adding alternate text to `\u003Cobject>` elements helps screen readers convey meaning to users. [Learn more about alt text for `object` elements](https://dequeuniversity.com/rules/axe/4.8/object-alt).",score:null,scoreDisplayMode:"notApplicable"},"select-name":{id:"select-name",title:"Select elements have associated label elements.",description:"Form elements without effective labels can create frustrating experiences for screen reader users. [Learn more about the `select` element](https://dequeuniversity.com/rules/axe/4.8/select-name).",score:null,scoreDisplayMode:"notApplicable"},"skip-link":{id:"skip-link",title:"Skip links are focusable.",description:"Including a skip link can help users skip to the main content to save time. [Learn more about skip links](https://dequeuniversity.com/rules/axe/4.8/skip-link).",score:null,scoreDisplayMode:"notApplicable"},tabindex:{id:"tabindex",title:"No element has a `[tabindex]` value greater than 0",description:"A value greater than 0 implies an explicit navigation ordering. Although technically valid, this often creates frustrating experiences for users who rely on assistive technologies. [Learn more about the `tabindex` attribute](https://dequeuniversity.com/rules/axe/4.8/tabindex).",score:null,scoreDisplayMode:"notApplicable"},"table-duplicate-name":{id:"table-duplicate-name",title:"Tables have different content in the summary attribute and `\u003Ccaption>`.",description:"The summary attribute should describe the table structure, while `\u003Ccaption>` should have the onscreen title. Accurate table mark-up helps users of screen readers. [Learn more about summary and caption](https://dequeuniversity.com/rules/axe/4.8/table-duplicate-name).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},"table-fake-caption":{id:"table-fake-caption",title:"Tables use `\u003Ccaption>` instead of cells with the `[colspan]` attribute to indicate a caption.",description:"Screen readers have features to make navigating tables easier. Ensuring that tables use the actual caption element instead of cells with the `[colspan]` attribute may improve the experience for screen reader users. [Learn more about captions](https://dequeuniversity.com/rules/axe/4.8/table-fake-caption).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},"target-size":{id:"target-size",title:"Touch targets have sufficient size and spacing.",description:"Touch targets with sufficient size and spacing help users who may have difficulty targeting small controls to activate the targets. [Learn more about touch targets](https://dequeuniversity.com/rules/axe/4.8/target-size).",score:null,scoreDisplayMode:"notApplicable"},"td-has-header":{id:"td-has-header",title:"`\u003Ctd>` elements in a large `\u003Ctable>` have one or more table headers.",description:"Screen readers have features to make navigating tables easier. Ensuring that `\u003Ctd>` elements in a large table (3 or more cells in width and height) have an associated table header may improve the experience for screen reader users. [Learn more about table headers](https://dequeuniversity.com/rules/axe/4.8/td-has-header).",score:null,scoreDisplayMode:"notApplicable"},"td-headers-attr":{id:"td-headers-attr",title:"Cells in a `\u003Ctable>` element that use the `[headers]` attribute refer to table cells within the same table.",description:"Screen readers have features to make navigating tables easier. Ensuring `\u003Ctd>` cells using the `[headers]` attribute only refer to other cells in the same table may improve the experience for screen reader users. [Learn more about the `headers` attribute](https://dequeuniversity.com/rules/axe/4.8/td-headers-attr).",score:1,scoreDisplayMode:"binary",details:{type:"table",headings:[],items:[]}},"th-has-data-cells":{id:"th-has-data-cells",title:"`\u003Cth>` elements and elements with `[role=\"columnheader\"/\"rowheader\"]` have data cells they describe.",description:"Screen readers have features to make navigating tables easier. Ensuring table headers always refer to some set of cells may improve the experience for screen reader users. [Learn more about table headers](https://dequeuniversity.com/rules/axe/4.8/th-has-data-cells).",score:null,scoreDisplayMode:"notApplicable"},"valid-lang":{id:"valid-lang",title:"`[lang]` attributes have a valid value",description:"Specifying a valid [BCP 47 language](https://www.w3.org/International/questions/qa-choosing-language-tags#question) on elements helps ensure that text is pronounced correctly by a screen reader. [Learn how to use the `lang` attribute](https://dequeuniversity.com/rules/axe/4.8/valid-lang).",score:null,scoreDisplayMode:"notApplicable"},"video-caption":{id:"video-caption",title:"`\u003Cvideo>` elements contain a `\u003Ctrack>` element with `[kind=\"captions\"]`",description:"When a video provides a caption it is easier for deaf and hearing impaired users to access its information. [Learn more about video captions](https://dequeuniversity.com/rules/axe/4.8/video-caption).",score:null,scoreDisplayMode:"notApplicable"},"custom-controls-labels":{id:"custom-controls-labels",title:"Custom controls have associated labels",description:"Custom interactive controls have associated labels, provided by aria-label or aria-labelledby. [Learn more about custom controls and labels](https://developer.chrome.com/docs/lighthouse/accessibility/custom-controls-labels/).",score:null,scoreDisplayMode:"manual"},"custom-controls-roles":{id:"custom-controls-roles",title:"Custom controls have ARIA roles",description:"Custom interactive controls have appropriate ARIA roles. [Learn how to add roles to custom controls](https://developer.chrome.com/docs/lighthouse/accessibility/custom-control-roles/).",score:null,scoreDisplayMode:"manual"},"focus-traps":{id:"focus-traps",title:"User focus is not accidentally trapped in a region",description:"A user can tab into and out of any control or region without accidentally trapping their focus. [Learn how to avoid focus traps](https://developer.chrome.com/docs/lighthouse/accessibility/focus-traps/).",score:null,scoreDisplayMode:"manual"},"focusable-controls":{id:"focusable-controls",title:"Interactive controls are keyboard focusable",description:"Custom interactive controls are keyboard focusable and display a focus indicator. [Learn how to make custom controls focusable](https://developer.chrome.com/docs/lighthouse/accessibility/focusable-controls/).",score:null,scoreDisplayMode:"manual"},"interactive-element-affordance":{id:"interactive-element-affordance",title:"Interactive elements indicate their purpose and state",description:"Interactive elements, such as links and buttons, should indicate their state and be distinguishable from non-interactive elements. [Learn how to decorate interactive elements with affordance hints](https://developer.chrome.com/docs/lighthouse/accessibility/interactive-element-affordance/).",score:null,scoreDisplayMode:"manual"},"logical-tab-order":{id:"logical-tab-order",title:"The page has a logical tab order",description:"Tabbing through the page follows the visual layout. Users cannot focus elements that are offscreen. [Learn more about logical tab ordering](https://developer.chrome.com/docs/lighthouse/accessibility/logical-tab-order/).",score:null,scoreDisplayMode:"manual"},"managed-focus":{id:"managed-focus",title:"The user's focus is directed to new conte
